/*!50003 CREATE*/ /*!50017 DEFINER=`admin`@`%`*/ /*!50003 TRIGGER processAlertTrans 
AFTER INSERT ON reader 
 FOR EACH ROW 
   BEGIN
   
    DECLARE studid integer;
    DECLARE entrytime DATETIME;
    
    select 
    sc.studentid, rdr.entry_time into studid, entrytime 
    from
    student_card sc,
    reader rdr
where
    exists( select 
            1
        from
            reader r
        where
            r.cardid = sc.cardid
        )  order by rdr.ENTRY_TIME desc
        limit 1;
      
     INSERT INTO ALERT_TRANS (ALERT_ID, STUDENT_ID, TIME,STATUS) 
     VALUES ('V1', studid, entrytime,'ACTIVE');
    
  END */;;
